import React from 'react';
import '../css/DashBoard.css';
import UserNavbar from './UserNavbar';
import Table from './TableProdut';
import { useLocation } from 'react-router-dom';

const Dashboad = () => {

    const location = useLocation(); // Hook para acessar o estado passado
    const user = location.state?.user; // Obtém os dados do usuário

    // Verifica se os dados do usuário existem
    if (!user) {
        alert("Você não está logado,");
    }
    return(
        <div className='DashBoardBody'>
            <UserNavbar>{user.nome}</UserNavbar> 
            <Table></Table> 
        </div>
    );
};

export default Dashboad;
